define({"topics" : [{"title":"Multithreaded Processing","id":"concept_jhh_psb_mz","href":"datacollector\/UserGuide\/Origins\/KinConsumer.html#concept_jhh_psb_mz","menu": {"hasChildren":false,},"tocID":"concept_jhh_psb_mz-d46e44308","topics":[]},{"title":"AWS Credentials","shortdesc":"\n               <p class=\"shortdesc\">When <span class=\"ph\">Data Collector</span> reads data from a Kinesis Consumer origin, it must pass credentials to Amazon Web         Services.\n               </p>\n            ","id":"concept_oxv_t5g_vw","href":"datacollector\/UserGuide\/Origins\/KinConsumer.html#concept_oxv_t5g_vw","menu": {"hasChildren":false,},"tocID":"concept_oxv_t5g_vw-d46e44330","topics":[]},{"title":"Read Interval","shortdesc":"\n               <p class=\"shortdesc\">You can configure the read interval for the Kinesis Consumer. The read interval   determines how long Kinesis Consumer waits\n                  before requesting additional data from Kinesis shards.   By default, the Kinesis Consumer waits one second between requests.\n                  \n               </p>\n            ","id":"concept_y55_dz4_yr","href":"datacollector\/UserGuide\/Origins\/KinConsumer.html#concept_y55_dz4_yr","menu": {"hasChildren":false,},"tocID":"concept_y55_dz4_yr-d46e44368","topics":[]},{"title":"Lease Table Tags","shortdesc":"\n               <p class=\"shortdesc\">The Kinesis Consumer origin stores offsets - the location where the origin stops         reading - in DynamoDB lease tables.\n                  You can optionally define tags to apply to a lease table         created by the origin. The origin cannot add tags to existing\n                  lease tables.\n               </p>\n            ","id":"concept_qy4_rky_vcb","href":"datacollector\/UserGuide\/Origins\/KinConsumer.html#concept_qy4_rky_vcb","menu": {"hasChildren":false,},"tocID":"concept_qy4_rky_vcb-d46e44413","topics":[]},{"title":"Resetting the Origin","id":"concept_dt1_4mq_h1b","href":"datacollector\/UserGuide\/Origins\/KinConsumer.html#concept_dt1_4mq_h1b","menu": {"hasChildren":false,},"tocID":"concept_dt1_4mq_h1b-d46e44468","topics":[]},{"title":"Data Formats","id":"concept_cwg_r2m_35","href":"datacollector\/UserGuide\/Origins\/KinConsumer.html#concept_cwg_r2m_35","menu": {"hasChildren":false,},"tocID":"concept_cwg_r2m_35-d46e44530","topics":[]},{"title":"Configuring a Kinesis Consumer Origin","id":"task_p4b_vv4_yr","href":"datacollector\/UserGuide\/Origins\/KinConsumer.html#task_p4b_vv4_yr","menu": {"hasChildren":false,},"tocID":"task_p4b_vv4_yr-d46e44602","topics":[]}]});